package com.san.amazon;

import java.util.*;

/**
 * Minimum Window Substring
 *
 * Solution
 * Given two strings s and t, return the minimum window in s which will contain all the characters in t. If there is no such window in s that covers all characters in t, return the empty string "".
 *
 * Note that If there is such a window, it is guaranteed that there will always be only one unique minimum window in s.
 *
 *
 *
 * Example 1:
 *
 * Input: s = "ADOBECODEBANC", t = "ABC"
 * Output: "BANC"
 * Example 2:
 *
 * Input: s = "a", t = "a"
 * Output: "a"
 *
 *
 * Constraints:
 *
 * 1 <= s.length, t.length <= 105
 * s and t consist of English letters.
 *
 *
 * Follow up: Could you find an algorithm that runs in O(n) time?
 */
public class MinimumWindowSubstring {
    public String minWindow(String s, String t) {
        if(s.length() == 0 || t.length() == 0) {
            return "";
        }

        int l=0;

        Map<Character, Integer> dictT = new HashMap<>();
        Map<Character, Integer> windowCounts = new HashMap<>();
        for(int i=0;i<t.length(); i++){
            Integer thisCharCount = dictT.getOrDefault(t.charAt(i), 0);
            dictT.put(t.charAt(i), ++thisCharCount);
        }
        int required = dictT.size();
        int charsFound = 0;
        int[] answer = {-1,0,0};

        for (int r=0;r<s.length(); r++) {
            char c = s.charAt(r);
            Integer thisCharCount = windowCounts.getOrDefault(c, 0);
            windowCounts.put(c, ++thisCharCount);

            if(dictT.containsKey(c) && windowCounts.get(c).intValue()==dictT.get(c).intValue()) {
                    charsFound++;
            }

            while(l<=r && charsFound==required){
                //We found all the chars. Now Try to shrink
                //record found answer
                if(answer[0] == -1 || r-l+1 < answer[0]){
                    answer[0] = r-l+1;
                    answer[1] = l;
                    answer[2] = r;
                }

                char charAtL = s.charAt(l);
                windowCounts.put(charAtL, windowCounts.get(charAtL)-1);

                if(dictT.containsKey(charAtL) && windowCounts.get(charAtL).intValue()<dictT.get(charAtL).intValue())
                    charsFound--;
                l++;
            }
        }

        return answer[0]==-1?"":s.substring(answer[1], answer[2]+1);
    }

    public static void main(String[] args) {
//        String s ="ADOBECODEBANC";
//        String t = "ABC";
//        String s ="A";
//        String t = "AA";

        String s = "bba";
        String t = "ab";

        /*String s = "";
        String t = "";
*/
        System.out.println(new MinimumWindowSubstring().minWindow(s, t));
    }
}
